import React from "react";
import notes  from  "../notes.js"

const createNote = (noteItem) => {
  return(
    <div className="note">
      <h1>{noteItem.title}</h1>
      <p>{noteItem.content}</p>
    </div>
  )
}

const Note = () => {
    {notes.map( noteItem  => createNote(noteItem) )}
};

export default Note;
